export default class User extends Component {
  componentDidMount = () => {
    this.props.GetUser();
  };
  render() {
    console.log(this.props.userData[0].l);
    return (
      <div>
        <div>{"Redux training"}</div>
        {this.props && this.props.userData.map(user => <div>{user.login}</div>)}
      </div>
    );
  }
}
